private SpatialArgs q(String shapeStr, double distErrPct) {
  Shape shape = ctx.readShape(shapeStr);
  SpatialArgs args = new SpatialArgs(SpatialOperation.Intersects, shape);
  args.setDistErrPct(distErrPct);
  return args;
}

